import React from 'react'
import { loginRequest } from '../../AuthenticationFolder/authConfig'
import { callForEvent } from './GraphCalls';
import { useState } from 'react';
import { useEffect } from 'react';
import { ResponseMode } from '@azure/msal-common';

export async function GetEvent (data, instance, accounts){
  var eventArr;

    const request = {
        ...loginRequest,
        account: accounts[0]
    };  
    instance.acquireTokenSilent(request).then(async (res) => {
        eventArr = await data.map((user) => {
          callForEvent(res.accessToken, user.userPrincipalName, user.accountEnabled).then((res) => {
            return ResponseMode;
          })
        })
    })
    return eventArr
}
